webpackJsonp([0x73ba101ee546],{522:function(n,a){n.exports={data:{markdownRemark:{html:'<h3>1. 斜体和粗体</h3>\n<p>使用 * 和 ** 表示斜体和粗体。</p>\n<p>示例：</p>\n<p>这是 <em>斜体</em>，这是 <strong>粗体</strong>。</p>\n<h3>2. 分级标题</h3>\n<p>使用 === 表示一级标题，使用 --- 表示二级标题。</p>\n<p>示例：</p>\n<div class="gatsby-highlight">\n      <pre class="language-text"><code class="language-text">这是一个一级标题\n============================\n\n这是一个二级标题\n--------------------------------------------------\n\n### 这是一个三级标题</code></pre>\n      </div>\n<p>你也可以选择在行首加井号表示不同级别的标题 (H1-H6)，例如：# H1, ## H2, ### H3，#### H4。</p>\n<h3>3. 外链接</h3>\n<p>使用 [描述](链接地址) 为文字增加外链接。</p>\n<p>示例：</p>\n<p>这是去往 <a href="http://ghosertblog.github.com">本人博客</a> 的链接。</p>\n<h3>4. 无序列表</h3>\n<p>使用 *，+，- 表示无序列表。</p>\n<p>示例：</p>\n<ul>\n<li>无序列表项 一</li>\n<li>无序列表项 二</li>\n<li>无序列表项 三</li>\n</ul>\n<h3>5. 有序列表</h3>\n<p>使用数字和点表示有序列表。</p>\n<p>示例：</p>\n<ol>\n<li>有序列表项 一</li>\n<li>有序列表项 二</li>\n<li>有序列表项 三</li>\n</ol>\n<h3>6. 文字引用</h3>\n<p>使用 > 表示文字引用。</p>\n<p>示例：</p>\n<blockquote>\n<p>野火烧不尽，春风吹又生。</p>\n</blockquote>\n<h3>7. 行内代码块</h3>\n<p>使用 `代码` 表示行内代码块。</p>\n<p>示例：</p>\n<p>让我们聊聊 <code class="language-text">html</code>。</p>\n<h3>8.  代码块</h3>\n<p>使用 四个缩进空格 表示代码块。</p>\n<p>示例：</p>\n<div class="gatsby-highlight">\n      <pre class="language-text"><code class="language-text">这是一个代码块，此行左侧有四个不可见的空格。</code></pre>\n      </div>\n<h3>9.  插入图像</h3>\n<p>使用 ![描述](图片链接地址) 插入图像。</p>\n<p>示例：</p>\n<p><img src="https://www.zybuluo.com/static/img/my_head.jpg" alt="我的头像"></p>\n<h1>Cmd Markdown 高阶语法手册</h1>\n<h3>1. 内容目录</h3>\n<p>在段落中填写 <code class="language-text">[TOC]</code> 以显示全文内容的目录结构。</p>\n<p>[TOC]</p>\n<h3>2. 标签分类</h3>\n<p>在编辑区任意行的列首位置输入以下代码给文稿标签：</p>\n<p>标签： 数学 英语 Markdown</p>\n<p>或者</p>\n<p>Tags： 数学 英语 Markdown</p>\n<h3>3. 删除线</h3>\n<p>使用 ~~ 表示删除线。</p>\n<p><del>这是一段错误的文本。</del></p>\n<h3>6. 加强的代码块</h3>\n<p>支持四十一种编程语言的语法高亮的显示，行号显示。</p>\n<p>非代码示例：</p>\n<div class="gatsby-highlight">\n      <pre class="language-text"><code class="language-text">$ sudo apt-get install vim-gnome</code></pre>\n      </div>\n<p>Python 示例：</p>\n<div class="gatsby-highlight">\n      <pre class="language-python"><code class="language-python">@requires_authorization\n<span class="token keyword">def</span> <span class="token function">somefunc</span><span class="token punctuation">(</span>param1<span class="token operator">=</span><span class="token string">\'\'</span><span class="token punctuation">,</span> param2<span class="token operator">=</span><span class="token number">0</span><span class="token punctuation">)</span><span class="token punctuation">:</span>\n    <span class="token triple-quoted-string string">\'\'\'A docstring\'\'\'</span>\n    <span class="token keyword">if</span> param1 <span class="token operator">></span> param2<span class="token punctuation">:</span> <span class="token comment"># interesting</span>\n        <span class="token keyword">print</span> <span class="token string">\'Greater\'</span>\n    <span class="token keyword">return</span> <span class="token punctuation">(</span>param2 <span class="token operator">-</span> param1 <span class="token operator">+</span> <span class="token number">1</span><span class="token punctuation">)</span> <span class="token operator">or</span> <span class="token boolean">None</span>\n\n<span class="token keyword">class</span> <span class="token class-name">SomeClass</span><span class="token punctuation">:</span>\n    <span class="token keyword">pass</span>\n\n<span class="token operator">>></span><span class="token operator">></span> message <span class="token operator">=</span> <span class="token triple-quoted-string string">\'\'\'interpreter\n... prompt\'\'\'</span></code></pre>\n      </div>\n<p>JavaScript 示例：</p>\n<div class="gatsby-highlight">\n      <pre class="language-javascript"><code class="language-javascript"><span class="token comment">/**\n* nth element in the fibonacci series.\n* @param n >= 0\n* @return the nth element, >= 0.\n*/</span>\n<span class="token keyword">function</span> <span class="token function">fib</span><span class="token punctuation">(</span>n<span class="token punctuation">)</span> <span class="token punctuation">{</span>\n  <span class="token keyword">var</span> a <span class="token operator">=</span> <span class="token number">1</span><span class="token punctuation">,</span> b <span class="token operator">=</span> <span class="token number">1</span><span class="token punctuation">;</span>\n  <span class="token keyword">var</span> tmp<span class="token punctuation">;</span>\n  <span class="token keyword">while</span> <span class="token punctuation">(</span><span class="token operator">--</span>n <span class="token operator">>=</span> <span class="token number">0</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>\n    tmp <span class="token operator">=</span> a<span class="token punctuation">;</span>\n    a <span class="token operator">+=</span> b<span class="token punctuation">;</span>\n    b <span class="token operator">=</span> tmp<span class="token punctuation">;</span>\n  <span class="token punctuation">}</span>\n  <span class="token keyword">return</span> a<span class="token punctuation">;</span>\n<span class="token punctuation">}</span>\n\ndocument<span class="token punctuation">.</span><span class="token function">write</span><span class="token punctuation">(</span><span class="token function">fib</span><span class="token punctuation">(</span><span class="token number">10</span><span class="token punctuation">)</span><span class="token punctuation">)</span><span class="token punctuation">;</span></code></pre>\n      </div>\n<h3>12. 表格支持</h3>\n<table>\n<thead>\n<tr>\n<th>项目</th>\n<th align="right">价格</th>\n<th align="center">数量</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>计算机</td>\n<td align="right">$\n1600</td>\n<td align="center">5</td>\n</tr>\n<tr>\n<td>手机</td>\n<td align="right">$\n12</td>\n<td align="center">12</td>\n</tr>\n<tr>\n<td>管线</td>\n<td align="right">$\n1</td>\n<td align="center">234</td>\n</tr>\n</tbody>\n</table>\n<h3>13. 定义型列表</h3>\n<p>名词 1\n:   定义 1（左侧有一个可见的冒号和四个不可见的空格）</p>\n<p>代码块 2\n:   这是代码块的定义（左侧有一个可见的冒号和四个不可见的空格）</p>\n<div class="gatsby-highlight">\n      <pre class="language-text"><code class="language-text">    代码块（左侧有八个不可见的空格）</code></pre>\n      </div>\n<h3>14. Html 标签</h3>\n<p>本站支持在 Markdown 语法中嵌套 Html 标签，譬如，你可以用 Html 写一个纵跨两行的表格：</p>\n<div class="gatsby-highlight">\n      <pre class="language-text"><code class="language-text">&lt;table&gt;\n    &lt;tr&gt;\n        &lt;th rowspan=&quot;2&quot;&gt;值班人员&lt;/th&gt;\n        &lt;th&gt;星期一&lt;/th&gt;\n        &lt;th&gt;星期二&lt;/th&gt;\n        &lt;th&gt;星期三&lt;/th&gt;\n    &lt;/tr&gt;\n    &lt;tr&gt;\n        &lt;td&gt;李强&lt;/td&gt;\n        &lt;td&gt;张明&lt;/td&gt;\n        &lt;td&gt;王平&lt;/td&gt;\n    &lt;/tr&gt;\n&lt;/table&gt;</code></pre>\n      </div>',frontmatter:{title:"各种情况测试",date:"November 04, 2018",tags:["前端","JavaScript"]}}},pathContext:{slug:"/test-each-case/"}}}});
